// import React from "react";
import Button from "./Button";
import logo from "../Assets/vividspace2.png"
const Header = () => {
    return (
        <div className="flex h-36 bg-vividblue ">
        <header className="">
        <img id="logo" src={logo} alt="logo"></img>
        <Button text="Sign In" className="px-5"/>
        <Button text="Sign Up" className="px-6"/>
        </header>
        </div>
    );

    }

    export default Header;
